import { BrowserRouter as Router, Route, Routes, RouterProvider } from 'react-router-dom';
import Header from './modules/Header'
import Sidebar from './modules/Sidebar'
function Filials () {
  return(
    <div className='card_main'></div>
  )
}

function App() {
  return (
    <div className="App">
      <Header/>
      <RouterProvider>
        <div className='wrapper gridx'>
          <Sidebar/>
          <Routes>
              <Route exact path='/' Component={Filials}/>
          </Routes>
        </div>
      </RouterProvider>
    </div>
  );
}

export default App;
